import React from 'react'
import './App.css'; /*import do css do projeto*/

function App() {
  return (
    <div>
      <h1>Cadastro de Ingressantes</h1>
      <form>
        <label>Nome</label>

        <label>Curso</label>
        <select>'Curso'</select>
      </form>
    </div>
  )
}

export default App;
